import React, { useState } from "react";
import "../styles/ReservarTurno.css";

const ReservarTurno = () => {
  const [profesor, setProfesor] = useState("");
  const [bloque, setBloque] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Turno reservado:", { profesor, bloque });
    alert("Turno reservado exitosamente.");
  };

  return (
    <div className="reservar-turno-container">
      <h1 className="reservar-un-turno-title">Reservar un turno</h1>
      <div className="reservar-turno-card">
        <h2 className="nuevo-turno-title">Nuevo turno</h2>
        <form className="reservar-turno-form" onSubmit={handleSubmit}>
          <label>
            Profesor:
            <select
              value={profesor}
              onChange={(e) => setProfesor(e.target.value)}
              required
            >
              <option value="">--Seleccione profesor--</option>
              <option value="Profesor 1">Profesor 1</option>
              <option value="Profesor 2">Profesor 2</option>
            </select>
          </label>
          <label>
            Bloque:
            <select
              value={bloque}
              onChange={(e) => setBloque(e.target.value)}
              required
            >
              <option value="">--Seleccione bloque--</option>
              <option value="Bloque 1">Bloque 1</option>
              <option value="Bloque 2">Bloque 2</option>
              <option value="Bloque 2">Bloque 2</option>
              <option value="Bloque 2">Bloque 2</option>
            </select>
          </label>
          <button type="submit" className="reservar-button">
            Reservar
          </button>
        </form>
      </div>
    </div>
  );
};

export default ReservarTurno;
